import React, { useState } from 'react';
import { Card } from 'antd';

const ContentComponent = () => {
    const [selectedCard, setSelectedCard] = useState(null);

    const cardData = [
        { id: 1, title: 'MAIB', content: 'Moldova Agroindbank', image: 'data:image/jpeg;base64,' },
        { id: 2, title: 'MICB', content: 'Moldindconbank', image: 'data:image/jpeg;base64,' },
        { id: 3, title: 'VictoriaBank', content: 'Victoriabank', image: 'data:image/jpeg;base64,' },
    ];

    const handleCardClick = (card) => {
        setSelectedCard(card);
    };

    return (
        <div>
            <div style={{ display: 'flex', flexWrap: 'wrap' }}>
                {cardData.map((item) => (
                    <div
                        key={item.id}
                        style={{
                            width: 300,
                            height: 200,
                            margin: 10,
                            backgroundImage: `url(${item.image})`,
                            backgroundSize: 'cover',
                            borderRadius: 10,
                            cursor: 'pointer'
                        }}
                        onClick={() => handleCardClick(item)}
                    />
                ))}
            </div>
            {selectedCard && (
                <div style={{ marginTop: 20 }}>
                    <h3>Selected Card:</h3>
                    <img alt={selectedCard.title} src={selectedCard.image} style={{ width: 300 }} />
                </div>
            )}
        </div>
    );
};

export default ContentComponent;
